import React  from 'react';
import './App.css';
import LunchOrder from './components/LunchOrder';
const tarProps = {
  dbName: "testDB",
  keys: {
    title: {
      type: "input",
      text: "標題"
    },
    content: {
      type: "input",
      text: "內容"
    },
    content2: {
      type: "input",
      text: "內容2"
    },
    time: {
      type: "datePicker",
      text: "時間"
    },
    remarks: {
      type: "textArea",
      text: "備註"
    }
  }
};

const tarDatas = [
  {
    id: 0,
    title: "t1",
    content: "hello",
    content2: "hello2",
    time: "2021-09-15",
    remarks: "no"
  },
  {
    id: 1,
    title: "t2",
    content: "apple",
    content2: "apple2",
    time: "2021-09-17",
    remarks: "no2"
  },
  {
    id: 2,
    title: "t3",
    content: "dog",
    content2: "dog2",
    time: "2021-09-19",
    remarks: "no3"
  }
];
function App() {
  return (
    <div className="App">
    <LunchOrder tarProps={tarProps} tarDatas={tarDatas}/>
    </div>
  );
}

export default App;
